import React from 'react';

class WelcomeComponent extends React.Component {
    render() {
        return (
            <div>
                Welcome {this.props.match.params.name}
                <br />
                You can manage your todos <link href="/todos">here</link>
            </div>
        );
    }
}

export default WelcomeComponent;
